    "Desc": "作为盗洞团伙中的突击前锋，「袭击者」和「偷袭者」经常挥舞着武器，独自冲在最前线。\n这并非是他们过于勇武，或者缺乏团队作战精神，而仅仅是为了避免误伤——他们手中的改制变压线圈时刻释放着高压电流，只需要轻轻一碰，就能麻痹甚至击晕对方。\n而在后勤困难的空洞中，一个暂时失去行动能力的队友，会成为整个小队的麻烦。\n「这是什么？让我研究一下！哦，好像是仿制的电棍棍棍棍棍棍棍…」",
