    "Desc": "在空洞中遭到烈性以太物质侵蚀变异的人形智慧生命，因本体具备一定程度的以太适性体质，故而躯体的以太转化还未彻底完成，保留了部分本体的人形特征。从残存的服饰与战斗经验来看极有可能是由混迹空洞内的匪帮/歹徒转化而来。\n从残存的身体结构来看，本体生前应该是使用远程武器的歹徒，以骸化夺去了他的意志与生命，但远距离战斗的本能与习惯似乎得到了保留，侵蚀体不仅会持续使用远程投射物攻击敌人，甚至其抛射物的威力/射击性能还在以太侵蚀下获得了额外的增强（抛射出尖锐的以太晶体或是某种混合爆炸物之类的）。\n「我跟多特说别去碰那个晶体，可他不听我的！那个冲动的白痴从来不听我的话。等我们要撤离空洞时，他就…变了…」",
