    "Name": "地精",
    "Desc": "在首次遇到这类特型以骸时，空洞调查员曾误以为它们有一定智力，甚至可以学习人类使用锤棍类武器，于是将其命名为「地精」。\n但后续的资料证实，所谓的「武器」只是它们异化变形的扭曲肢体，他们并不具备模仿人类的能力。\n不过尽管如此，地精却依旧是一类相当难缠的对手。其健壮的体格、蛮横的力量，能够让最简单的挥击也极具杀伤力。\n一旦有任何东西闯入它们的领地，它们则会进入暴怒状态，不惜一切代价砸烂眼前的挑衅者。\n「嗯？有只地精跑过来了，还在敲打一堆废铁。」\n「总觉得这家伙的攻击很有节奏，叮叮当当，就好像在打架子鼓一样…」\n「喂！你们两个别发呆了！它砸的不是废铁，是我们的物资车！」",
    "Rarity": 2,
    "GroupId": 201,
    "GroupDesc": "以太异形",
    "CardObtain": "【未探明】击败1次以获得数据",
    "CardQuote": "——匪帮的空洞临时驻扎点里，闯进来了一只「地精」",
    "CardSkillDesc": "战斗中，地精会释放战吼强化自身，提高自身的伤害并大幅减少自身受到的伤害，但该效果在其失衡时就会失效。"
