    "Name": "泰拉斯奎祸车",
    "Desc": "空洞调查协会根据现有的调查推测，「泰拉斯奎祸车」的躯干内部似乎储存着各种类型、不同烈度的液化以太。\n当它将储存的以太进行搅拌混合时，复杂的链式反应会瞬间释放出毁灭性的暴烈能量；其威力不亚于防卫军配备的重型火炮。\n而越是经验丰富的调查员，越会懂得低调行事，尽量避免被它的「重炮」直接轰击。\n「在它冲我低头俯身时，我还以为那是某种怪异的见面礼；可当它的炮膛亮起来后，我才醒悟…那是饯别礼。」",
    "Rarity": 2,
    "GroupId": 201,
    "GroupDesc": "以太异形",
    "CardObtain": "【未探明】击败1次以获得数据",
    "CardQuote": "——《空洞茶会》访谈 ，某位明星调查员的自述经历",
    "CardSkillDesc": "战斗中，泰拉斯奎祸车会使用持续激光攻击，并且倾向于利用左右跳跃调整身位。"
