    "Name": "死路屠夫",
    "Desc": "与其他的高威胁以骸不同，虽然「死路屠夫」有着骇人的庞大体型，其体内的以太却经常处于低活性的休止状态。\n尽管如此，「死路屠夫」依然拥有撕碎一切障碍物的蛮横力量；整片扭曲毁坏的地铁区域，都是它的「后厨禁地」。\n而只有当某个具有威胁性的目标勾起了「死路屠夫」的强烈兴趣时，恐怖的质变才会在瞬间发生——\n它体内积蓄的高浓度以太会在数毫秒之间尽数烈性化；呈指数级暴涨的能量促使它的肢体迅速畸变，扭曲成更加暴虐、更加贪婪的「餐食姿态」。\n这也意味着「前菜时间」已经结束，一场无与伦比的「饕餮盛宴」正式开幕。\n如果不想成为这场「宴席」的一部分，那么误入此间的盗洞客一定要慎之又慎地挑选路线，尽量离它的「后厨」远一点…\n[该空洞内的路径较为复杂，但可以确定的是，当「它」出现在道路尽头时，此路即是「死路」]",
    "Rarity": 4,
    "GroupId": 201,
    "GroupDesc": "以太异形",
    "CardObtain": "【未探明】击败1次以获得数据",
    "CardQuote": "——空洞调查协会关于「死路空洞」的第17号调查记录",
    "CardSkillDesc": "在战斗中，死路屠夫攻击方式大开大合，受到一定伤害后会进入第二阶段，第二阶段下其攻击会更加疯狂，并可以使用激光攻击；第二阶段下，在其疯狂的连段结束后对其使用高量级攻击会额外触发其硬直。"
