    "Name": "「提丰·挑战者型」",
    "Desc": "作为重型机甲，提丰·挑战者型丝毫没有加装远程火力，而是将全部性能用在了以太动能装甲的强化上。\n冲击、重击、碾压…提丰·挑战者型用简单高效的战术动作，将动能装甲的破坏力发挥到了极致。其打击造成的震爆效果甚至能威慑大型以骸。\n面对难以靠近的提丰·挑战者型，即使是最为老练的盗洞客，也只会发出一丝无能为力的叹息。\n「挺拔雄健的身躯，粗壮有力的臂膀…嗯，果真是我的理想型…我是说型号。」",
    "Rarity": 3,
    "GroupId": 205,
    "GroupDesc": "叛军",
    "CardObtain": "【未探明】击败1次以获得数据",
