    "Name": "离子体·纳塞勒亚",
    "Desc": "空洞内不同种类的以太异形，有着各自迥然不同的作战风格。\n有的狠厉，有的狡诈，而有的行事风格则可以称得上是…光明正大。\n而「纳塞勒亚」则属于其中极为特殊的一类。\n它们经常会站在引人瞩目的角落，堂而皇之地凝聚自身的烈性以太，最终利用浓郁的破坏性能量，为身边的以骸们扫清眼前一切碍事的家伙。\n于此同时，周围的以骸会疯狂地发起攻击，为纳塞勒亚的蓄力攻击争取足够的时间。\n「快，打断那个家伙，不要让它憋大招！」\n「要是被它打中了，岂不是显得我们像是反派一样！」",
    "Rarity": 1,
    "GroupId": 201,
    "GroupDesc": "以太异形",
    "CardObtain": "【未探明】击败1次以获得数据",
    "CardQuote": "——空洞深处，几名调查员正在围攻纳塞勒亚",
    "CardSkillDesc": "战斗中，离子体·纳塞勒亚倾向于进行长时间的蓄力，从而生成出高量级的能量球攻击敌人；其蓄力期间受到以太伤害或高量级攻击时，能量球会提前掉落，对周围单位造成范围伤害。"
