    "Name": "色雷斯人",
    "Desc": "以古文明传说中的战士民族命名的凶恶以骸，传言只有最骁勇的英雄和最疯狂的恶棍才能在以太的腐化中化身此等凶物。\n——事实并非如此，虽然你在空洞和健身房里锻炼出的健美肌肉，以及临死前过量释放的肾上腺素，都的确有可能帮助你成为你生前同伴们的大麻烦。不过想来他们不会和一个已经死透透的老朋友计较的，对不对？\n无所谓啦，当你英俊的面孔变成了黑色的诡异能量球，还计较什么社交声誉呢？\n「不愧是老大，变成以骸了也这么能打！」\n「他天天泡健身房的时候我就觉得不妙！」",
    "Rarity": 3,
    "GroupId": 201,
    "GroupDesc": "以太异形",
