    "Name": "特勤护卫",
    "Desc": "特勤护卫，看起来像是普通的安保人员，但千万别小看他们。其实他们背后藏着一堆「神秘技能」。特勤护卫的职责不仅仅是站在门口显得威风十足，还得随时准备在老板喝太多酒时稳住局面，或者在小偷小摸的家伙面前摆出「我什么大场面没有见过」的表情。他们的工作不是打击犯罪，而是「防止老板摔倒、把门口的电梯修好，并且，尽可能保持低调」。在他们的世界里，最强大的武器其实是「看起来好厉害！」，而最幸运的事就是「无所事事」。毕竟，一个优秀的特勤护卫永远不会让人意识到自己的存在，直到问题解决后人们才恍然大悟：哦，原来有他们在呢。\n「只要你站得够稳，那就谁都没有你狠。」",
