    "Name": "尼尼微",
    "Desc": "虽然被标记为「极度危险」的「互利型共生以骸群」，「尼尼微」那独特而瑰丽的外表依旧很难让人产生警惕感。\n仅存的调查记录显示，随着「尼尼微」不断舒展身体，高浓度烈性以太便会通过「根茎」汇聚至它的核心，为其源源不断地提供能量。有学者推测，它的这一行为与植物的光合作用有着近似的原理。\n在它摇曳身姿的过程中，部分活性过高的以太能量会不断倾泻而出；当其积蓄的烈性以太近乎满溢时，它便会变换仪态，显露出真正的「盛开」姿态。\n而璀璨绽放的瞬间，死亡也如影而至。\n「好消息是：它并没有恶意，只是在吸收养料进行光合作用；坏消息是…我们就是养料。」",
    "Rarity": 4,
    "GroupId": 201,
    "GroupDesc": "以太异形",
