    "CardQuote": "——防卫军关于零号空洞的调查行动记录，编号K-411",
    "CardSkillDesc": "战斗中，尼尼微会使用大范围的招式和密集的弹幕进行攻击，并且会召唤骸蜂协助战斗。"
