    "Name": "萨提尔·蓄能型",
    "Desc": "于新艾利都地铁空洞内首次目击的人形活体以太。空洞协会的调查队对其性质曾有一段时间的争议，有人相信它是由侵蚀体被高度异化后转换的活体以太，也有人主张它就是纯粹的活体以太，只不过受到了空洞内环境的深入影响。不论如何，鉴于其行动智能有限，协会对其危险评级并不高，但这并不意味着可以掉以轻心，毕竟它们通常结队出现。\n「你有没有因为一个红灯而迟到或被罚款的经历？很讨厌的感觉对吧？」\n「现在，泄愤的机会来了！」",
