    "Name": "绽壳虫",
    "Desc": "在空洞调查协会的研究报告中，移速低、只会引发的小型爆炸的雷蛛被定义为「低威胁」、「无需关注」的低级以骸。\n但一些嗅觉敏锐的商家却从其圆滚滚的体型和小短腿中察觉到了商机。\n伴随着电影《翻滚吧，小雷蛛》的火热上映，其玩偶、抱枕等周边商品几乎卖到脱销。\n「没想到它们的玩偶竟然比本体更有杀伤力…比利，我下个月只能吃泡面了…」",
    "Rarity": 1,
    "GroupId": 201,
    "GroupDesc": "以太异形",
