    "Name": "轰击猎兵",
    "Desc": "「掷弹猎兵」和「轰击猎兵」配备有改制版「Mamba-TG3」型单兵火箭筒，其特制的弹药中含有活性以太燃爆剂，能快速摧毁敌人的机甲单位，有效杀伤空洞内的大型以骸。\n而为了抵消发射时的后坐力、增加瞄准精度，他们需要接受特殊握持姿势的训练。防卫军的统计数据显示，在该项目上表现出众的新兵，几乎都有过摄影方面的相关经验。\n「这东西使用方法和肩扛式摄影机差不多。」\n「首先用你的镜头锁定目标，然后一边扣动发射器的扳机，一边默念——」\n「喂，蠢货！…笑一个！」",
