    "Desc": "白金邦布，是比黄金邦布更加稀有的神秘存在。\n华丽的外表，极高的稀缺性，这让它们在流浪邦布群体中享有崇高的地位。\n高贵，尊贵，至高无上——\n比起黄金邦布那种浑身闪着粗俗金光的家伙，白金邦布才是流浪邦布中最高雅的贵族！\n无论身处何处，流浪邦布们见到了它，都要尊敬地弯下腰拜三拜，恭恭敬敬喊一声「嗯呢嗯呢」！\n不过，对于盗洞客来说，高不高贵不重要。\n在看见它的瞬间，盗洞客们就如同就发现了一座移动的金库。\n「这小东西长得这么金贵，一拳打下去，能爆不少丁尼吧？」",
