    "Name": "游魂·蓄能型",
    "Desc": "似乎是受到了芭莱大厦内部别具一格的装潢氛围影响，「游魂」有着艺术雕塑般怪异扭曲的肢体构造。\n有一部分调查员认为，它特殊的造型，是为了更好地保护自己的以太核心。\n但更多调查员坚持认为，这一切只是它用来吸引敌人注意力的噱头；当敌人被他怪异的姿态迷惑时，「游魂」则会毫不犹豫地用浓缩以太向对方发起远程攻击。\n「我盯着它的造型愣了好一会：难道它想用自己的脑袋打一场保龄球吗？」\n「可还没等我想明白，它的『保龄球』就已经砸在了我的脸上…」",
    "Rarity": 1,
    "GroupId": 201,
    "GroupDesc": "以太异形",
