    "Name": "恶毒打手",
    "Desc": "在空洞中遭到烈性以太物质侵蚀变异的可怜虫，因本体具备一定程度的以太适性体质，故而躯体的以太转化还未彻底完成，保留了部分本体的人形特征。从残存的服饰与战斗经验来看极有可能是由混迹空洞内的匪帮/歹徒转化而来。\n虽然混迹空洞的匪帮暴徒都会佩戴一定程度的抗侵蚀装备，但由于缺乏得当的维护或者单纯运气不好，一些歹徒还是会在空洞内活动时因遭到烈性以太物质侵蚀而变为怪物。这些还残存着生前本体战斗经验的以骸在某些程度上可能是比纯正的以骸更棘手的敌人。\n「生为匪患，死为灾难。也算表里如一了。」",
