    "Desc": "虽然在空洞调查协会的资料库中，「眼魔引擎」属于只有在近距离接触时才具有一定威胁性的以骸。但在实际的空洞调查行动中，它却经常带来意料之外的威胁。\n当黑暗深处的一双眼睛死死盯住自己、逐步逼近时，即使是经验丰富的调查员，也会产生一种难以言表的恐慌。\n而在空洞中，恐惧往往会加剧自身所受的以太侵蚀，进而招致灾祸。\n「破除恐惧的唯一方法…就是凝视它，瞪回去。」",
