    "Name": "哈提头犬·蓄能型",
    "Desc": "形似四足野兽但具备显著知性的活体以太，非常危险。由空洞调查协会第一期调查队正式纪录在案。\n据传其首次目击是在蝼巢空洞内，游荡于附近荒野的流浪者们盛传曾听到过某种凄厉的嘶吼，彷佛野兽长嗥。\n「我要是扔个棍子或皮球出去，你说这怪物会去捡嘛？」\n「你可以试试，不过住院的费用我可不报销。」",
