    "Desc": "防卫军配备的自律型战术机甲，可为前线人员提供持续的火力支援。\n其配备的惰性以太盾可抵御绝大多数轻型火力，甚至能抗下大型以骸的猛力重击。\n毫无疑问，它是防卫军内部最值得信赖的「战友」之一。\n「记住了，遇到麻烦就躲到它身后…这样你唯一的受伤概率，就是被它不小心踩了一脚。」",
