    "CardSkillDesc": "战斗中，「护戍盾卫Ω型」攻势更加凶猛，且会展开护盾，护盾展开期间无法累积电属性之外的属性异常积蓄值，对其施加[感电]效果，或使其进入失衡状态时，能够直接击破护盾。"
