    "Desc": "相比于全副武装的空洞调查员，「魁梧施虐者」和「通缉虐待狂」们的装备几乎堪称简陋。\n但最恶劣的暴徒，往往只需要最朴素的凶器。\n一根带钉金属球棒、外加一把改制双管霰弹枪，就足以让他们成为空洞内人见人怕的恶霸。\n据曾经与他们对战过的调查员回忆，这些家伙在战斗时会陷入某种极度亢奋的状态；其行动方式很难称之为「作战」，而更像是好勇斗狠之人发起的「恶意霸凌」。\n「和他们打架，勾起了我当年独自面对校霸时的恐惧…」",
