    "Name": "祸首·通缉打手",
    "Desc": "新艾利都地下世界有条共识：最凶狠的拳击手，不是赛场上的「连胜冠军」，而是空洞深处的「魁梧打手」和「通缉打手」——他们是被以太盗窃团伙高价雇佣而来的职业暴徒，专门负责看管盗掘而来的以太资源。\n作为痴迷于拳击的格斗家，「魁梧打手」不擅长摆弄精密的电子设备，而是干脆将高压电击枪改制成「拳套」戴在手上，为双拳增加额外的破坏力。\n以骸、盗洞客，空洞调查员、落单的治安局小队…在「魁梧打手」和「通缉打手」的眼里，他们甚至算不上是「敌人」，而仅仅是消遣用的「训练沙袋」。「等等！这家伙的格斗架势，我好像在四分街的街机厅里看到过！」",
    "Rarity": 3,
    "GroupId": 202,
    "GroupDesc": "暴徒",
    "CardObtain": "【未探明】击败1次以获得数据",
    "CardQuote": "——空洞中，比利正在对付冲过来的打手们",
    "CardSkillDesc": "战斗中，祸首·通缉打手的攻势极其凶猛，并且积极侧闪调整攻击角度。"
