    "Name": "多佩冈亚·莫尔斯",
    "Desc": "即使是在以诡谲怪诞而著称的离子体之中，「离子体·多佩冈亚」也算是极其特殊的类型。\n它们能够让特殊的活性以太离子覆盖体表，从而精确地模仿目标的外形，甚至可以做到以假乱真的地步。无论是细节还是质感，都和本体难辨真假。\n更难缠的是，它们甚至可以模仿本体各种气势凌厉、威力十足的战斗技巧。\n没人知道它究竟是从何处获得了自己模仿对象的情报，有传言称它能读心，能从对手的记忆里挑出最适合的挑战者，然后以那个姿态侵袭而来。\n「扯淡！它要真能读到我内心恐惧，它就该变成一个手拿衣架的凶狠中年妇女！没错，我就怕我老妈！」",
    "Rarity": 2,
    "GroupId": 290,
    "GroupDesc": "特殊",
    "CardObtain": "【未探明】击败1次以获得数据",
    "CardQuote": "——绳网论坛，某个盗洞客的吐槽帖",
    "CardSkillDesc": "战斗中，该敌人会施展和其模仿对象完全一致的招式；其会视战场情况选择近身连击或远程射击，生命值低于一定比例或一定时间后，会额外使用远距离发动的追加攻击或快速位移后的死角射击对目标进行突袭。"
