    "Name": "恶名·杜拉罕",
    "Desc": "强大的人形活体以太，在湖镇空洞中被首次目击，由空洞调查协会第三期调查队记录在案。目前尚不清楚此类活体以太的诞生与湖城布雷兹的陷落有何关系。\n鉴于其强大的力量与富有知性的战斗方式，空洞调查协会给予了它较危险的评级，生手调查员应避免与之直接冲突。\n「别让它点亮那把剑，如果它已经点亮了…别被它砍到。」",
