    "Name": "「卫士Ⅱ型」",
    "Desc": "只有在大型空洞作战行动中，防卫军才会派出「卫士」这类全副武装的机甲。\n活性以太震爆弹、以太蓄能枪「MARS-74」、聚变热能射线…阵线守护者堪称是治安局移动的武器装备库。\n而它在全面强化火力的同时，依旧保留了惊人的高机动性。能跳跃冲刺、驱散成群的小型以骸，有条不紊地推进战线。\n对盗洞客来说，哪怕仅有一台「卫士」横在面前，也是难以逾越的堡垒。\n「我将以堡垒形态出击！」",
