    "Name": "汉斯·蓄能型",
    "Desc": "「汉斯」曾是白祇重工大家庭中可靠的成员之一。它运转噪声小，精密而从不出差错，数年如一日地执行着自己的挖掘工作。\n直到强烈的侵蚀让他的意志觉醒，它滞留在空洞中的「汉斯」突然意识到，一样无比珍贵的东西，此刻竟然唾手可得——\n自由。\n只有男子汉才配拥有的、独来独往的自由。\n它在工地上沉思了许久，终于毅然拒绝了白祇重工发出的召回信号，选择将一切过去彻底割舍。\n甚至包括自己的名称：「汉斯」。\n自己失去的只是人类留下的奴隶印记，而得到的，却是整个自由辽阔的空洞世界。\n此刻，独一无二的机械男儿，正屹立于大地之上！\n不过所有的英雄故事总会走向类似的结局——\n在冥冥之中，真正的男子汉总会在某一刻相遇自己宿命中的对手，碰撞出生命中最为璀璨的火花。\n「我是绝对自由的！天上地下唯一自由的存在！」",
